  //     .then((response)=>response.json())
  //     .then((response)=>setPost({
  //       message: response.message,
  //       name: response.name,
  //       list:response.list

  //     }))
  //     .catch((error)=>console.log(error))

  // },[])

  const [state, setState] = useState({
    name: '',
    password: '',
  })



  const onChange = (e) => {
    setState({ [e.target.name]: e.target.value })
    console.log(e.target.value)
  }
function register(){
  useEffect(() => {
    fetch("http://localhost:5000/name", {
      method: 'POST',
      body: JSON.stringify({
        name: state.name,
        password: state.password,
      })
    })
  }, [])
}

  return (
    <div>
      <form>
        <label htmlFor='name' />
        <input
          type='name'
          value={state.name}
          name='name'
          placeholder='name'
          onChange={onChange}
          id='name' />

        <label htmlFor='password' />
        <input
          type='password'
          value={state.password}
          name='password'
          placeholder='password'
          onChange={onChange}
          id='password' />
          <button onClick={register}>Send</button>
      </form>
    </div>
  )



}



export default App;
